import styled from 'styled-components';

export const Wrapper = styled.div`
  background: linear-gradient(
    to bottom, rgba(0,0,0,0)
    41%, rgba(0,0,0,0.65)
    100%
  ),
`;

export const Content = styled.div`
  padding: 20px;
  max-width: 1280p;
  margin: 0 auto;
`;

export const Text = styled.div`
  position: absolute;
`;
